def neural_network_model_sig3(x):
	l0=x-tf.reduce_mean(x,0)
	l0=tf.nn.l2_normalize(l0,0)
	l0=tf.nn.sigmoid(l0)
	l1=tf.add(tf.matmul(l0,layer_1['ratio']),layer_1['bias'])
	return l1
	
